import React, { Component } from "react";

class NewLyric extends Component {
    constructor () {
        super();
        this.state = {
            randomIndex: 7
        }
    }

changeQuote() {
        this.setState({
            randomIndex: Math.floor(Math.random() * 20)
        }) 
    }
    render() {
        return (
            <button onClick={changeQuote}>Next Bar</button>
        )
    }
}

export default NewLyric
